EXP.bxpsci437_enterprise_datacenter_jira_aware = (function(){
    // Setup segment tracking object and Optimizely Utils
    var tracking = new window.GROW.Analytics('17804900793'),
        utils = window.optimizely.get('utils');

    var resources_update = {
        card_1: {
            badge: 'White Paper',
            background_color: '',
            image_src: '//cdn.optimizely.com/img/1096093/7d89ae21ea4549cbb0dee437d8fbe8fa.png',
            title: 'An admin\'s guide to getting started with Jira Software Data Center',
            href: 'http://atlassian.com/enterprise/whitepapers/jira-software-data-center/success'
        },
        card_2: {
            badge: 'White Paper',
            background_color: '#ABF5D1',
            image_src: '//cdn.optimizely.com/img/1096093/4e173d028eb3464593a6c63d850607db.png',
            title: 'The ultimate guide to Atlassian Data Center',
            href: 'https://www.atlassian.com/whitepapers/atlassian-data-center-guide'
        },
        card_3: {
            badge: 'Blog',
            background_color: '#B3F5FF',
            image_src: '//cdn.optimizely.com/img/1096093/e0ec09c935dd49bb82ec846608fefba6.png',
            title: 'How IBM leveraged Jira Data Center to build a foundation for the future',
            href: 'https://www.atlassian.com/blog/jira-software/how-ibm-built-a-future-with-jira-data-center'
        }
    };


    var init = function() {
        tracking.send('bxpsci437_enrolled');

        updateResourceExtension(resources_update);

        tracking.send('bxpsci437_treated');
    },
    updateResourceExtension = function(resources_update){
        Object.keys(resources_update).forEach(function(key){
            addWait(resources_update[key], key);
        });
    },
    addWait = function(resources, key){
        var elem = '.resource-card-block.' + key.replace('_','-');
        utils.waitForElement(elem + ' .resource-badge').then(function(badge){
            jQuery(badge).text(resources.badge);
        });

        utils.waitForElement(elem + ' img').then(function(image){
            jQuery(image).attr('src', resources.image_src);
        });

        utils.waitForElement(elem + ' h4').then(function(h4){
            jQuery(h4).html(resources.title);
        });

        utils.waitForElement(elem + ' a').then(function(href){
            jQuery(href).attr('href', resources.href);
        });

        if(resources.background_color != ''){
            utils.waitForElement(elem + ' .resource-card-image').then(function(href){
                jQuery(href).attr('style', 'background:'+ resources.background_color + ' !important;');
            });
        }
    };
    return {
        init: init
    };
})();

EXP.bxpsci437_enterprise_datacenter_jira_aware.init();
