EXP.SCALE_tracking_shared = (function(){
    // Setup segment tracking object and Optimizely Utils
    var tracking = new window.GROW.Analytics('SCALE'),
        utils = window.optimizely.get('utils'),
        pathname = window.location.pathname.toLowerCase();

    var nonStandardWhitepapers = [
        'www.atlassian.com/agile/agile-at-scale/beyond-the-basics-whitepaper',
        'www.atlassian.com/enterprise/data-center/server-to-data-center-the-tipping-point',
        'www.atlassian.com/enterprise/data-center/scaling-git-with-bitbucket-data-center',
        'www.atlassian.com/forrester/esm'
    ];

    // Pre-processing for whitepapers
    if(pathname.includes('whitepapers') || nonStandardWhitepapers.includes(pathname)){
        pathname = 'whitepaper';
    }

    // Tracking objects
    var for_tracking_enterprise_datacenter_jira = {
        "contact_us" : { selector : 'a[href="/enterprise/contact"]' },
        "try_free" : { selector : '.theme-one a[href="/software/jira/download/data-center"]' },
    },
    for_tracking_enterprise_datacenter_confluence = {
        "contact_us" : { selector : 'a[href="/enterprise/contact"]' },
        "try_free" : { selector : '.theme-one a[href="/software/confluence/download/data-center"]' },
    },
    for_tracking_enterprise_datacenter_jira_servicedesk = {
        "contact_us" : { selector : 'a[href="/enterprise/contact"]' },
        "try_free" : { selector : '.theme-one a[href="/software/jira/service-desk/download/data-center"]' },
    },
    for_tracking_enterprise_datacenter_bitbucket = {
        "contact_us" : { selector : 'a[href="/enterprise/contact"]' },
        "try_free" : { selector : 'a.green-solid' },
    },
    for_tracking_software_jira_download_datacenter = {
        "download" : { selector : '#download-view' },
        "aws" : { selector : 'a[href="/enterprise/data-center/aws"]' },
        "azure" : { selector : 'a[href="/enterprise/data-center/azure"]' },
    },
    for_tracking_software_confluence_download_datacenter = {
        "download" : { selector : '#second-page-area .button' },
    },
    for_tracking_software_jira_servicedesk_download_datacenter = {
        "download" : { selector : '#download-view .button' },
    },
    for_tracking_software_bitbucket_download_datacenter = {
        "download" : { selector : '#download-view .button' },
    };
    
    var featuredBlogs = [
        '/blog/jira-software/how-ibm-built-a-future-with-jira-data-center',
        '/blog/jira-software/jira-largest-enterprise-customers-scaling-infographic',
        '/blog/jira-software/human-side-scaling-jira-software-governance-custom-fields-admins',
        '/blog/confluence/how-to-build-an-information-architecture-strategy-for-confluence',
        '/blog/confluence/building-a-business-case-for-confluence-data-center-enterprise',
        '/blog/bitbucket/bitbucket-data-centers-largest-customers-scale-git',
        '/blog/git/smart-mirroring-cures-poor-git-performance',
        '/blog/it-teams/5-signs-service-desk-at-capacity',
    ];

    var init = function() {
        tracking.send('SCALE_enrolled');

        switch(pathname){
            case '/enterprise/data-center/jira':
                addTracking(for_tracking_enterprise_datacenter_jira);
                break;

            case '/enterprise/data-center/confluence':
                addTracking(for_tracking_enterprise_datacenter_confluence);
                break;

            case '/enterprise/data-center/jira/service-desk':
                addTracking(for_tracking_enterprise_datacenter_jira_servicedesk);
                break;

            case '/enterprise/data-center/bitbucket':
                addTracking(for_tracking_enterprise_datacenter_bitbucket);
                break;

            case '/software/jira/download/data-center':
                addTracking(for_tracking_software_jira_download_datacenter);
                break;

            case '/software/confluence/download/data-center':
                addTracking(for_tracking_software_confluence_download_datacenter);
                break;

            case '/software/jira/service-desk/download/data-center':
                addTracking(for_tracking_software_jira_servicedesk_download_datacenter);
                break;

            case '/software/bitbucket/download/data-center':
                addTracking(for_tracking_software_bitbucket_download_datacenter);
                break;

            case '/enterprise/data-center/data-center-business-case-toolkit':
                // 1138 gated toolkit code
                trackMarketoForm(1138);
                break;

            case '/software/jira/service-desk/customers':
                // 1020 gated eBook code
                trackMarketoForm(1020);
                break;

            case 'whitepaper':
                // 1107 gated white paper code
                trackMarketoForm(1107);
                break;

            default:
                break;
        }

        if(featuredBlogs.includes(pathname)){
            tracking.send('featured_blog_visit');
        }

        checkIncrementalBand();

        tracking.send('SCALE_treated');
    },
    trackMarketoForm = function(formId){
        utils.waitForElement(".mktoButtonRow button").then(function() {
            MktoForms2.getForm(formId).onSuccess(function(){
                tracking.send('marketo_form_success_' + formId);
            });
        });
    },
    checkIncrementalBand = function(){
        var visitor  = optimizely.get('visitor');
        // 17862783912 - Marketo DCP table
        // 17929810406 - Marketo Enterprise Behavior Score
        if(visitor.dcpData && visitor.dcpData.attributes && 17862783912 in visitor.dcpData.attributes && 17929810406 in visitor.dcpData.attributes[17862783912]){
            var currentScore = visitor.dcpData.attributes[17862783912][17929810406];
            if(localStorage && 'scale' in localStorage){
                var scale = JSON.parse(localStorage.getItem('scale'));
                if('incremental' in scale){
                    var inc = scale['incremental'];
                    // 86400000 - 1 Day in ms
                    if(new Date(Date.now()) - new Date(inc.dls) > 86400000){
                        var delta = currentScore - inc.i;
                        if(delta == 0 && !inc.b0){
                            tracking.send('band_no_change');
                            inc.dls = new Date(Date.now());
                            inc.b0 = true;
                        }else if(delta >= 1 && delta <= 30 && !inc.b1){
                            tracking.send('band_1_30');
                            inc.dls = new Date(Date.now());
                            inc.b1 = true;
                        }else if(delta >= 31 && delta <= 75 && !inc.b2){
                            tracking.send('band_31_75');
                            inc.dls = new Date(Date.now());
                            inc.b2 = true;
                        }else if(delta >= 76 && delta <= 100 && !inc.b3){
                            tracking.send('band_76_100');
                            inc.dls = new Date(Date.now());
                            inc.b3 = true;
                        }else if(delta >= 101 && !inc.b4){
                            tracking.send('band_101');
                            inc.dls = new Date(Date.now());
                            inc.b4 = true;
                        }
                        scale['incremental'] = inc;
                        localStorage.setItem('scale', JSON.stringify(scale));
                    }
                }else{
                    scale['incremental'] = setInitialScaleInc(currentScore);
                    localStorage.setItem('scale', JSON.stringify(scale));
                }
            }else{
                var scale = {'incremental': setInitialScaleInc(currentScore)};
                localStorage.setItem('scale', JSON.stringify(scale));
            }
        }
    },
    setInitialScaleInc = function(score){
        return {
            i: score,
            dls: new Date(Date.now()),
            b0: false,
            b1: false,
            b2: false,
            b3: false,
            b4: false,
        };
    },
    addTracking = function(forTracking){
        // adding additional tracking to each page
        for(var key in forTracking){
            var selector = forTracking[key].selector;
            var event_name = 'clicked_' + key; // creates event name for tracking
            applyEventHandler(selector, event_name); // assigns the tracking event to a handler. Must use a separate function here because of asynchroneity
        }
    },
    applyEventHandler = function(selector, event_name){
        jQuery(selector).on('click', function(){
            tracking.send(event_name);
        });
    };
    return {
        init: init
    };
})();

