window.optimizely = window.optimizely || [];
var EXP = EXP || {};
jQuery('html').addClass('sci517');
jQuery('head').append('<style> main{ display: none} </style>');

EXP.sci517_smartXp = (function() {
  var bp_rank = {},
      for_tracking,
      images = {
        jsw_img : '//cdn.optimizely.com/img/1096093/c581d951b9674d8684648c2700f50bc6.png', 
        con_img : '//cdn.optimizely.com/img/1096093/c6f5a932e7624538af941199b91c400e.png', 
        jsd_img : '//cdn.optimizely.com/img/1096093/ef04cb5f57fb46ca96f5d1e023c3039e.png',
        jsw_land_img : '//cdn.optimizely.com/img/1096093/e08974b77b6041f4a95f7ad29a0cc567.png',
        con_land_img : '//cdn.optimizely.com/img/1096093/e2d3f43494734f22adf4d0b19ee5757b.png',
        jsd_land_img : '//cdn.optimizely.com/img/1096093/dd28867313e04432b538900bf85574e9.png',
        jsw_img_deactivate: '//cdn.optimizely.com/img/1096093/4f8ab0fa116e4624a12fcfd65acb1e71.png',
        con_img_deactivate: '//cdn.optimizely.com/img/1096093/45aa5bf708904a06a3f787796b6db2d2.png',
        jsd_img_deactivate: '//cdn.optimizely.com/img/1096093/f6ee3c50bbf74cdcb754c75c89384b2b.png'
      },
      opt = '',
      merged = false,
      num_bundles = 0,
      pathname = window.location.pathname,
      states = {},
      tracking = new window.GROW.Analytics('18109551582'),
      utils = window.optimizely.get('utils');

  window.localStorage.setItem('bxp_bundle_free', true);

  // object with information for additional tracking
  for_tracking = {
    jsw_button      : { selector : '.sci517 .jsw-block-517 a'         , version : ['con'] },
    con_button      : { selector : '.sci517 .con-block-517 a'         , version : ['jsw', 'jsd']  },
    jsd_button      : { selector : '.sci517 .jsd-block-517 a'         , version : ['jsw', 'con']  },
    signup_button   : { selector : '.sci517 .signup-517'              , version : ['jsw', 'con', 'jsd']  },
    atlassian_link  : { selector : '.sci517 .xs-none .light-text img' , version : ['jsw', 'con', 'jsd']  },
    compare_plans   : { selector : '.sci517 .server-dl-517'           , version : ['jsw', 'con', 'jsd']  },
    primary_card    : { selector : '.sci517 .primary-img-517'         , version : ['jsw', 'con', 'jsd']  },
    jsw_card        : { selector : '.sci517 .jsw-block-517'           , version : ['con']  },
    con_card        : { selector : '.sci517 .con-block-517'           , version : ['jsw', 'jsd']  },
    jsd_card        : { selector : '.sci517 .jsd-block-517'           , version : ['jsw', 'con']  },
  };

  // trimming any trailing '/'
  if(pathname[pathname.length-1] === '/'){
    pathname = pathname.slice(0,-1);
  }

  // choosing appropriate bundle page
  switch (pathname){
    case '/software/jira/free':
      opt = 'jsw';
      break;

    case '/software/confluence/free':
      opt = 'con';
      break;

    case '/software/jira/service-desk/free':
      opt = 'jsd';
      break;

    default:
      jQuery('head').append('<style> main{ display: initial !important} </style>');
      throw('error - invalid pathname');
  }

  var init = function(){
    tracking.send('sci517_enrolled_bundles_E2');
    setDefaultRanks();
    setStates(bp_rank);

    if(states){
      utils.waitForElement('main').then(function(main){
        modifyMain(main);
      });
    }
    
  },
  setDefaultRanks = function(){
    switch (opt) {
        case 'jsw':
          bp_rank = { 'jsw': 1, 'con': 2, 'jsd': 3};
          break;

        case 'con':
          bp_rank = { 'jsw': 2, 'con': 1, 'jsd': 3};
          break;

        case 'jsd':
          bp_rank = { 'jsw': -1, 'con': 2, 'jsd': 1};
          break;

        default:
          throw('build_error-get_state');
    }
  },
  setStates = function(bp_rank){
    var primary,
        first,
        second;

    for (var key in bp_rank){
      if (bp_rank[key] === 1){
        primary = key.toString();
      } else if (bp_rank[key] === 2){
        first = key.toString();
      } else if (bp_rank[key] === 3){ 
        second = key.toString();
      }
    }

    states[primary]   = { start_pos : -1, added : true };
    
    if(first){
      states[first]   = { start_pos : 2, added : false , pair: second };
      num_bundles++;
    }
    
    if(second){
      states[second]  = { start_pos : 3, added : false , pair: first };
      num_bundles++;
    }
  },
  modifyMain = function(element){
    var content = getBundlesContent(),
        new_content = jQuery(content),
        main = jQuery(element);

    try { 
      // checking for a returned html string
      if(content){
        // adding content
        main.empty();
        main.append(new_content);

        // adding additional listeners
        setTryFreeListeners();
        setWidthListener();
        setSignupListner();

        //showing the page again
        main.show();

        // adding additional tracking
        addTracking(for_tracking);
        tracking.send('sci517_treated_bundles_E2');
      }else{
        // if the new content comes back undefined, give the default experience
        main.show();
        tracking.send('build_error-content_undefined_fallback');
      }
    } catch(e) {
      tracking.send(e);
      main.show();
    }   
  },
  getBundlesContent = function(){
    var header = getHeader(),
    leftColumn = getLeftColumn(),
    rightColumn = getRightColumn();
    
    return(header + leftColumn + rightColumn);
  },
  getHeader = function(){
    // Returning html for the top header of the page
    return '<div class="container-fluid xs-none"> <div class="row flex-container"> <div class="column column-md-12 text-center vertical-middle light-text"> <div class="component component--image spacer"> <img id="583b1445" src="https://wac-cdn.atlassian.com/dam/jcr:93075b1a-484c-4fe5-8a4f-942710e51760/Atlassian-horizontal-blue@2x-rgb.png?cdnVersion=644" alt="Logo" class="component__image" style="width:250px;margin-bottom:0;"> </div> </div> </div> </div>';
  },
  getLeftColumn = function(){
    var link,
        res;

    link = opt === 'jsw' ? 'jira' : (opt == 'con' ? 'confluence' : 'jira/service-desk');

    res = '<div class="container-fluid xs-none"><div class="row flex-container"><div class="column column-md-10 column-sm-11 shadow-container-517">'+
          '<div class="column-lg-5 column-md-12 left-column-517"><h1 class="boost-517">Our cloud products</h1><h1 class="boost-517">work even better</h1><h1 style="margin-bottom:24px" class="boost-517">together</h1><div class="row ins-517" style="padding-left:16px;"></div>'+
          '<h2 id="comp-fl-517" class="comp-exp-517">Get another one for free</h2><br><h4 class="section-header-517 trial-517">EACH PRODUCT ON A FREE PLAN:</h4><div class="features-517">'+
          '<img class="checkmark-517" src="//cdn.optimizely.com/img/1096093/e98c86af4af44c7aa726f372dc98c84f.png"><h4 class="feature-517">Supports up to 10 users or 3 agents</h4>'+
          '<img class="checkmark-517" src="//cdn.optimizely.com/img/1096093/e98c86af4af44c7aa726f372dc98c84f.png"><h4 class="feature-517">Includes 2 GB of storage</h4>'+
          '<img class="checkmark-517" src="//cdn.optimizely.com/img/1096093/e98c86af4af44c7aa726f372dc98c84f.png"><h4 class="feature-517">Offers Community support</h4>'+
          '<img class="checkmark-517" src="//cdn.optimizely.com/img/1096093/e98c86af4af44c7aa726f372dc98c84f.png"><h4 class="feature-517">Is always free, no credit card needed</h4></div>'+
          '<div class="server-trial-517"><img src="//cdn.optimizely.com/img/1096093/ae76bbe9d9f7468987d51a00b2507465.png" style="width:30px;float:left;margin-top:4px;margin-right:7px;"><div style="float: left;"><div class="tooltip">Larger team?<span class="tooltiptext">Standard and premium plans support up to 5,000 users or agents and include at least 250 GB of storage</span></div><br><a class="server-dl-517" href="https://www.atlassian.com/software/' + link + '/pricing">Compare plans</a></div></div></div>';

    return res;
  },
  getRightColumn = function(){
    // Returning the html for the right column
    var first_option,
        second_option;

    res = getPrimaryBlock();

    for( var key in states){
      // building any necessary bundle cards
      if(states[key].start_pos === 2){
        first_option = getBundleBlock(key, states[key].start_pos);
      }

      if(states[key].start_pos === 3){
        second_option = getBundleBlock(key, states[key].start_pos);
      }
    }
    // adding additional cards as long as they are defined
    res += first_option ? first_option : '';
    res += second_option ? second_option : '';

    res += getButtonBlock() + '</div>';
    return res;
  },
  getBundleBlock = function(product, start_pos){
    var prod_key = product + '_img',
        deactivate_key = product + '_img_deactivate',
        prod_img = images[prod_key],
        deactivate_img = images[deactivate_key],
        block_class = product + '-block-517',
        button_class = product + '-button',
        res,
        style,
        value_prop;

        switch (product){
          case 'jsw':
            style = 'max-height:41px !important;'; style_deselect = 'max-height:40px !important;';
            value_prop = 'The world\'s most popular project management tool and the easiest way to bring ideas in Confluence to life.';
            break;
          case 'con':
            style = 'max-height:38px !important;'; style_deselect = 'max-height:38px !important;';
            value_prop = (opt === 'jsw' ? 'Add context to your projects with a single source of truth for product requirements, release notes, and documentation.' : 'Deflect common requests and solve issues faster by linking self-serve knowledge to your service desk.');
            break;
          case 'jsd':
            style = 'max-height:44px !important;margin-top:19px !important;'; style_deselect = 'max-height:44px !important;margin-top:19px !important;';
            value_prop = 'One platform where your dev, IT, and support teams can collaborate more often and solve issues faster.';
            break;
        }

    res = '<div class="column block-theme-one-517 ' + block_class + '"><div class="column__background"><div class="row white-row-517"><div class="column-xs-8"><img style="' + style + '" class="prod-img-517" src="' + prod_img + '"><img style="' + style_deselect + 'display:none;" class="deactivate-img-517" src="' + deactivate_img + '"></div>'+
          '<div class="column-xs-4"><a class="button standard button--regular text-center prod-free-517 ' + button_class + '">Select</a></div></div>'+  
          '<div class="row white-row-517"><div class="column" style="padding-top:2px;"><p class="bundle-prop">' + value_prop + '</p></div></div></div></div>';

    return res;
  },
  getButtonBlock = function(){
    // Returning html for the signup button block
    var link,
        res;

    switch (opt) {
      case 'jsw':
        link = 'jira-software';
        break;

      case 'con':
        link = 'confluence';
        break;

      case 'jsd':
        link = 'jira-service-desk';
        break;

      default:
        throw('build_error-button_block');
    }

    res = '<div class="column next-col-' + num_bundles + '-517"><div class="row"><a href="/try/cloud/signup?bundle=' + link + '" class="button standard button--regular text-center signup-517">Next</a></div><div class="row"><h4 class="credit-517">NO CREDIT CARD REQUIRED</h4></div></div></div>';
    return res;
  },
  getPrimaryBlock = function(){
    if(opt != 'jsd'){
      var header_text = 'SELECT UP TO ONE MORE FREE TRIAL'
    }else{
      var header_text = 'SELECT ANOTHER FREE TRIAL  '
    }
    // Returning html for the start of the right column and primary product card
    var res = '<div class="column-lg-6 column-md-12 right-column-517"><div class="header-div-517 selection"><h3 class="section-header-517">YOU SELECTED</h3></div>'+
              '<div class="row">';

    switch (opt) {
      case 'jsw':
        res += '<img style="max-height: 76px !important" class="primary-img-517" src="' + images.jsw_land_img + '"></div>';
        break;

      case 'con':
        res += '<img style="max-height: 67px !important" class="primary-img-517" src="' + images.con_land_img + '"></div>';
        break;

      case 'jsd':
        res += '<img style="max-height: 78px !important;" class="primary-img-517" src="' + images.jsd_land_img + '"></div>';
        break;

      default:
        throw('build_error-primary_block');
    }
    res += '<div class="header-div-517 prod-section"><h3 class="section-header-517">' + header_text + '</h3></div>';
    return res;
  },
  getSvg = function(){
    // Returning html for the server svg
    return '<svg class="server-svg-517" width="20px" height="23px" viewBox="0 0 20 23" version="1.1" xmlns="http://www.w3.org/2000/svg" xmlns:xlink="http://www.w3.org/1999/xlink"><title>Bitmap</title><desc>Created with Sketch.</desc><g id="Symbols" stroke="none" stroke-width="1" fill="none" fill-rule="evenodd"><g id="looking-for-server?-no-price-"><g id="looking-for-server?--no-price-"><image id="Bitmap" x="0" y="0" width="20" height="23" xlink:href="data:image/png;base64,"></image></g></g></g></svg>';
  },
  setButtonHref = function(){
    // Updating the signup button HREF
    switch (opt) {
      case 'jsw':
        setJswHref();
        break;

      case 'con':
        setConHref();
        break;

      case 'jsd':
        setJsdHref();
        break;

      default:
        tracking.send('runtime_error-setting_href');
    };
  },
  setJswHref = function(){
    // Updating the signup button HREF based on selected products
    var href = '/try/cloud/signup?bundle=jira-software';
    
    if(states.jsd.added) {
      href += '-jira-service-desk';
    }
    if(states.con.added) {
      href += '-confluence';
    }
    href+='&edition=free'
    jQuery('.signup-517').attr('href', href);
  },
  setConHref = function(){
    // Updating the signup button HREF based on selected products
    var href = '/try/cloud/signup?bundle=confluence';
    if(states.jsw.added && states.jsd.added){
      href = '/try/cloud/signup?bundle=jira-software-jira-service-desk-confluence';
    }else{
      if(states.jsw.added) {
        href += '-jira-software';
      }
      if(states.jsd.added) {
        href += '-jira-service-desk';
      }
    }
    href+='&edition=free'
    jQuery('.signup-517').attr('href', href);
  },
  setJsdHref = function(){
    // Updating the signup button HREF based on selected products
    var href = '/try/cloud/signup?bundle=jira-service-desk';
    if(states.con.added) {
      href += '-confluence';
    }
    href+='&edition=free'
    jQuery('.signup-517').attr('href', href);
  },
  setSignupListner = function() {
    // Sending a track call of the bundled products when the signup button is clicked
    jQuery('.signup-517').on('click',function(){
      var selected_products = { products : [] };
      for (var key in states){
        if (states[key].added){
          selected_products.products.push(key);
        }
      }
      
      tracking.send('sci517_selected_products', selected_products);
    });
  },
  setWidthListener = function(){
    // This listener waits for the screen width to reach the stacking collapse point
    // At that point the right column is inserted into the middle of the left column
    // and vice versa
    jQuery(window).on('resize', function(){
      var width = jQuery(this).width();
      if( width <= 1024 && merged === false ){
        jQuery('.sci517 .ins-517').append(jQuery('.right-column-517'));
        merged = true;
      }else if ( width > 1024 && merged === true){
        jQuery('.right-column-517').insertAfter('.left-column-517');
        merged = false;
      }
    });
  },
  setTryFreeListeners = function(){
    // Setting listeners to the bundle option buttons
    // The listeners call the animation method and also updates the buttons href based on selected products
    var jsw_block = jQuery('.jsw-block-517'),
        con_block = jQuery('.con-block-517'),
        jsd_block = jQuery('.jsd-block-517'),
        jsw_btn = jQuery('.jsw-button'),
        con_btn = jQuery('.con-button'),
        jsd_btn = jQuery('.jsd-button');
    
    if(jsw_block.length > 0){
      jsw_block.on('click', function(){
        var pair = states['jsw'].pair,
            pair_block = jQuery('.'+pair+'-block-517');

        updateBundleBlocks('jsw', pair);
        setButtonHref();
      });
    }

    if(con_block.length > 0){
      con_block.on('click', function(){
        var pair = states['con'].pair,
            pair_block = jQuery('.'+pair+'-block-517');

        updateBundleBlocks('con', pair);
        setButtonHref();
      });
    }

    if(jsd_block.length > 0){
      jsd_block.on('click', function(){
        var pair = states['jsd'].pair,
            pair_block = jQuery('.'+pair+'-block-517');

        updateBundleBlocks('jsd', pair);
        setButtonHref();
      });
    }
  },
  updateBundleBlocks = function(clicked, pair){
    var clicked_block = '.' + clicked + '-block-517';
    if(pair){
      var pair_block = '.' + pair + '-block-517';
    }
    
    if(!states[clicked].added){
      $(clicked_block).addClass('added');
      $(clicked_block + ' .prod-img-517').css('display', 'initial');
      $(clicked_block + ' .deactivate-img-517').css('display', 'none');
      $(clicked_block + ' .button').addClass('select_button').removeClass('deselect_button');
      $(clicked_block + ' .button').text('Remove');
      states[clicked].added = true;

      if(pair){
        $(pair_block).removeClass('added');
        $(pair_block + ' .prod-img-517').css('display', 'none');
        $(pair_block + ' .deactivate-img-517').css('display', 'initial');
        $(pair_block + ' .button').addClass('deselect_button').removeClass('select_button');
        $(pair_block + ' .button').text('Select');  
        states[pair].added = false;
      }
    }else{
      $(clicked_block).removeClass('added');
      $(clicked_block + ' .button').removeClass('select_button').text('Select');
      states[clicked].added = false;

      if(pair){
        $(pair_block + ' .prod-img-517').css('display', 'initial');
        $(pair_block + ' .deactivate-img-517').css('display', 'none');
        $(pair_block + ' .button').removeClass('deselect_button');  
        states[pair].added = false;
      }
    }
  },
  addTracking = function(forTracking){
    // adding additional tracking to each page
    for(var key in forTracking){
      if(forTracking[key].version.includes(opt)){
        var selector = forTracking[key]['selector'];
        var event_name = 'sci517_click_' + key;
        applyEventHandler(selector, event_name);
      }
    }
  },
  applyEventHandler = function(selector, event_name){
    jQuery(selector).on('click', function(){
      tracking.sendToSegment(event_name);
      tracking.sendToOptimizely(event_name.replace('sci517_click_','')); //stripping the header for Optimizely, due to API name length restriction
    });
  };
  return {
    init: init
  };
})();

EXP.sci517_smartXp.init();
