        second;
    for (var key in bp_rank){
      if (bp_rank[key] === 1){
        primary = key.toString();
      } else if (bp_rank[key] === 2){
        first = key.toString();
      } else if (bp_rank[key] === 3){ 
        second = key.toString();
      }
    }

    states[primary]   = { start_pos : -1, added : true };
    
    if(first){
      states[first]   = { start_pos : 2, added : false , pair: second };
      num_bundles++;
    }
    
